二.变量提升
首先要明白 js 的代码要被执行，经历了声明和赋值两个步骤(先有声明，后有赋值),同时声明本身会被提前，这里要注意函数有函数表达式和函数变量两种声明方式，函数表达式会被首先提升，例如：
//报错undefined而不是 Uncaught ReferenceError: a is not defined
console.log(a);
var a = 10;

foo(); //输出1
var foo;
function foo(){
  console.log(1)
}
foo = function(){
    console.log(2)
}

同时变量提升也和作用域有关 注意！！！作用域在函数定义的时候就确定了，而不是在调用的时候

如图所示:
(1):包含着整个全局作用域，其中只有一个标识符：foo。
(2):包含着 foo 所创建的作用域，其中有三个标识符：a、bar 和 b。
(3):包含着 bar 所创建的作用域，其中只有一个标识符：c。
注意ES5 中没有块级作用域，只有函数作用域，因此可以将函数作用域理解为包含的一个个气泡。如：
for(var i = 0;i&lt;10;i++){
  console.log(i)
}

这里我们在 for 循环的头部直接定义了变量 i，通常是因为只想在 for 循环内部的上下文中使 用 i，而忽略了 i 会被绑定在外部作用域（函数或全局）中的事实。
最后当代码执行过程中，内部作用域可以访问外部作用域，反之则不行

接下来看题目
function bar() {
  if (!foo) {
    var foo = 10;
  }
  console.log(foo);
}
bar();

解析：
（1）首先在全局作用域中声明了函数表达式 bar，函数内部由于没有块级作用域，所以在函数内部作用域中声明了 foo，并且是 undefined。
（2) 当执行 bar()时，判断结果为 true，对 foo 赋值为 10，最终打印 10
//题目4：
var a = 0;
if (true) {
  a = 1;
  function a() {}
  a = 21;
  console.log(a);
}
console.log(a);

解析：
（1）首先在全局作用域中声明了函数 a，然后声明了变量 a，此时变量 a 覆盖了函数 a，并赋值为 undefined
（2）当执行时，(这里新旧浏览器对块级作用域的处理方式不同，详情请见)赋值为 21，所以两个都打印 21

